import Lien from "./Lien.jsx"
import styled from 'styled-components';


const Footer = () => {
    return (
        <Wrapper>

            <div>
            <text className="LU">Liens utiles</text>
            <hr className="LigneG"></hr>
            <Links>
                <Lien className="Link">Accueil</Lien>
                <Lien className="Link">Formations</Lien>
                <Lien className="Link">Quizz</Lien>
                <Lien className="Link">Espace personnel</Lien>
            </Links>
            </div>

            <Right>
                <text className="TxtRight"> Rejoins nous sur les r√©seaux <span className="exclamation">!</span></text>
                <hr className="LigneD"></hr>
            </Right>
        </Wrapper>
    );
};

const Wrapper = styled.section`
    display:flex;

    background-color:#E54B4B;
    padding-left:5rem;
    .LU{
        display:flex;
        padding-top:3.4rem;
        color:white;
        font-size:25px;
        font-weight:700;
    };
    .LigneG{
        height:2px;
        border: none;
        background-color:white;
        margin-bottom:20px;
    }
`;
const Links = styled.section`
    display:flex;
    flex-direction:column;
    padding-bottom:50px;
    .Link{
        margin-bottom:0.5rem;     
    };
`
const Right = styled.section`
    flex-direction:column;
    /* height:100%; */
    padding-top:7rem;
    display:flex;
    position:absolute;
    right:30px;
    .TxtRight{
        font-size:25px;
        font-weight:700;
        color:white;
    }
    .exclamation{
        position:absolute;

        left:0 ;
        transform: rotate(17.95deg);
        font-size:50px;
        font-weight:700;
    }
    .LigneD{
        height:2px;
        border: none;
        background-color:white;
        margin-bottom:20px;
    }
`
export default Footer;
